import React from 'react'

function Home() {
  return (
<div
  className="w-100 frow f-sb-bw margin-b-10"
  style={{
    maxWidth: "1200px",
    width: "99%",
    margin: "auto",
    marginBottom: "20px",
  }}
>
  {/* Header Section */}
  <div>
    <div
      className="filter-info v-center frow margin-b-20 margin-t-10"
      style={{
        height: "40px",
        alignItems: "center",
      }}
    >
      <div>
        <h1
          className="h6 text-bold margin-r-5"
          style={{
            fontSize: "22px",
          }}
        >
          Banquet Halls in Coimbatore
        </h1>
        <p className="regular margin-r-5">
          Showing{" "}
          <span className="text-bold">240 results</span> as per your search
          criteria
        </p>
      </div>
    </div>
  </div>

  {/* Search and View Options Section */}
  <div className="f-sb-bw" style={{ width: "400px" }}>
    {/* Search Box */}
    <div className="center" style={{ marginRight: "auto" }}>
      <div
        className="center extra-radius bg-white sc-eWRdud euuVgf"
        style={{
          height: "40px",
          width: "250px",
        }}
      >
        <div className="SuggestionsWithDetailsSearch sc-kEYyzF KNsWm">
          <div className="tag-search Search-Box extra-radius">
            <svg
              className="MuiSvgIcon-root icon margin-r-5"
              focusable="false"
              viewBox="0 0 24 24"
              aria-hidden="true"
              style={{
                color: "#909090",
              }}
            >
              <path d="M15.5 14h-.79l-.28-.27C15.41 12.59 16 11.11 16 9.5 16 5.91 13.09 3 9.5 3S3 5.91 3 9.5 5.91 16 9.5 16c1.61 0 3.09-.59 4.23-1.57l.27.28v.79l5 4.99L20.49 19l-4.99-5zm-6 0C7.01 14 5 11.99 5 9.5S7.01 5 9.5 5 14 7.01 14 9.5 11.99 14 9.5 14z" />
            </svg>
            <input
              type="text"
              style={{
                border: "none",
              }}
              className="small w-100 bg-white"
              value=""
              placeholder="Search Wedding Venues..."
            />
          </div>
        </div>
      </div>
    </div>

    {/* View Options */}
    <div className="f-sb-bw" style={{ marginLeft: "2%", width: "127px" }}>
      {/* List View */}
      <div
        className="f-sb-bw"
        style={{
          cursor: "pointer",
          marginRight: "15px",
          width: "54px",
        }}
      >
        <img
          src="https://images.wedmegood.com/react-frontend-v4/static/media/ListBlackIcon.c88b0d38.svg"
          alt="list"
          width="20"
          height="14"
        />
        <p
          style={{
            marginLeft: "5px",
            fontSize: "16px",
          }}
        >
          List
        </p>
      </div>

      {/* Grid View */}
      <div
        className="f-sb-bw"
        style={{
          cursor: "pointer",
          width: "53px",
          color: "rgb(231, 46, 119)",
        }}
      >
        <img
          src="https://images.wedmegood.com/react-frontend-v4/static/media/GridColoured.ade2802b.svg"
          alt="grid"
          width="14"
          height="14"
        />
        <p
          style={{
            marginLeft: "5px",
            fontSize: "16px",
          }}
        >
          Grid
        </p>
      </div>
    </div>
  </div>
</div>


  )
}

export default Home
